source: |-
  (defv a 1)
  (defv b 2)
  (defv c 2)
  (defv sum 2)
  (loop firstloop
      (setq c b)
      (setq b (+ b a))
      (setq a c)
      (if (> b 4000000)
          (return-from firstloop)
      )
      (if (= (% b 2) 0)
          (setq sum (+ sum b))
      )
  )
  (print sum)
